import React from 'react'
import styles from './styles.module.css'
import img from './Bitmap.svg'
import img1 from './Bg.svg'
import {useState} from 'react'

 const CreatePage = () => {

    const {loading,error,request} = useHttp()
    
    const [form,setForm] = useState({
        email: '', password:''
    }) 

    const changeHandler = event => {
        setForm({...form, [event.target.name]: event.target.value})
    }

    const registerHandler = async () => {
        try{
            const data = await request('/api/auth/register', 'POST', {...form})
            console.log("Data",data)

        }
        catch (err) {

        }
    }
    return (
        <div className="wrapp">
            <header>
            <div className={styles.wrappTitle}>
                         <img src={img}></img>
                         <a href="/" className={styles.title}>MORDOR</a>
                         </div>
            </header>
            <div className={styles.wrappMain}>
                <form className={styles.wrappColumn}>
                    <h2 className={styles.titleUp}>Sign up</h2>
                <div className={styles.wrappForm}>
                    <label className={styles.labels} onChange={changeHandler} type="text">Name*</label>
                        <input type="text" className={styles.inputColumn}></input> 
                    </div>
                    <div  >
                    <label className={styles.labels} onChange={changeHandler} type="email">Email*</label>
                        <input type="email" className={styles.inputColumn}></input> 
                    </div>
                    <div>
                    <label className={styles.labels} onChange={changeHandler} type="text">Password*</label>
                        <input type="text" className={styles.inputColumn}></input> 
                    </div>
                    <button className={styles.Sign}>Sign up</button>
                </form>
            </div>
            

            
        </div>
    )
}

export default CreatePage
